import { Table } from 'antd';
import type { ColumnsType } from 'antd/es/table';
import React from 'react';
import { useGetPredictions } from '../../../hooks/useGetPredictions';
import { IPrediction } from '../../../interfaces/prediction';

interface DataType {
  key: React.Key;
  patient: string;
  desease: string;
  result: number;
  status: string;
}

const columns: ColumnsType<IPrediction> = [
  {
    title: 'Patient Name',
    dataIndex: 'patient',
    key: 'patient',
    render: text => <a>{text}</a>,
  },
  {
    title: 'Desease',
    dataIndex: 'desease',
    key: 'desease',
    responsive: ['md'],
  },
  {
    title: 'Result',
    dataIndex: 'result',
    key: 'result',
    responsive: ['sm'],
  },
  {
    title: 'Status',
    dataIndex: 'status',
    key: 'status',
    responsive: ['sm'],
  },
];

const data: IPrediction[] = useGetPredictions();

const ClassificationTable = () => <Table columns={columns} dataSource={data} />;

export default ClassificationTable;
